sys_variable_value.value:
(function parse(inputs, outputs) {

// Source item string is available in inputs.sourceItem.
// Generate output by setting fields of outputs.targetObject.
// 
// The structure of outputs.targetObject corresponds to the
// structure defined in the Data Stream Action output.
// 
// Optionally skip an item in the stream by setting
// outputs.state = 'SKIP'
//
// JSON Example:
// var item = JSON.parse(inputs.sourceItem);
// outputs.targetObject.ffName = item.firstName;
// outputs.targetObject.llName = item.lastName;
// outputs.targetObject.address.home.city = item.address.home.city;
//
// XML Example: 
// var xmlDoc = new XMLDocument2();
// xmlDoc.parseXML(inputs.sourceItem);
// var root = xmlDoc.getDocumentElement();
// if (root.getNodeName() != 'user') {
//     outputs.state = 'SKIP';
//     return;
// }
// outputs.targetObject.id = xmlDoc.getNodeText('/user/id');
// outputs.targetObject.fname = xmlDoc.getNodeText('/user/person/first_name');
// outputs.targetObject.lname = xmlDoc.getNodeText('/user/person/last_name');

var features = JSON.parse(inputs.sourceItem);
outputs.targetObject.id = features.properties.id;
outputs.targetObject.name = features.properties.name;
outputs.targetObject.facility_type = features.properties.facility_type;
outputs.targetObject.classification = features.properties.classification;
outputs.targetObject.website = features.properties.website;
outputs.targetObject.time_zone = features.properties.time_zone;
outputs.targetObject.phone = features.properties.phone;
outputs.targetObject.hours = features.properties.hours;
outputs.targetObject.operational_hours_special_instructions = features.properties.operational_hours_special_instructions;
outputs.targetObject.wait_times = features.properties.wait_times;
outputs.targetObject.mobile = features.properties.mobile;
outputs.targetObject.active_status = features.properties.active_status;
outputs.targetObject.operating_status = features.properties.operating_status;
outputs.targetObject.visn = features.properties.visn;
outputs.targetObject.latitude = features.geometry.coordinates[0]
outputs.targetObject.longitude = features.geometry.coordinates[1];




})(inputs, outputs);

